column8:
人気のロングマットが新サイズで登場しました。ふちの折り返し部分が大きくなっ、床面によりフィットする新形状。
サイズはミニバンやコンパクトカーの２列目席にピッタリな１２５ＣＭタイプと軽自動車の後席に合う１１５ＣＭタイプの２サイズを用意しました。(フロア形状がフラットな車両にご使用いただけます）
裏面はずれにくい滑り止め加工。
<br>
<br>
品　番 ： ６４００－０５<br>
品　質 ： （表）ポリエステル１００％<br> 
サイズ ： （０４）４０Ｘ１２５ｃｍ <br>
カラー ： ＢＫ（ブラック）　ＢＥ（ベージュ）　ＧＲ（グレー ）<br><style type="text/css">
