裏面素材に超強力ノンスリップ素材(マクスパイダー)を使用。車両本体のニードルパンチカーペットにマックスパイダーがガッチリと絡みます。
底面形状は前方の傾斜が緩やかなオリジナル形状(意匠登録申請中）でフィット性も向上しました。前席用には別売のズレ防止フックが使える丸穴付き。
<br>
<br>

